function Header() 
{
    return(
        <div>
            <nav>
                <ul style={{listStyle:"none"}}>
                    <li>Contact</li>
                    <li>About</li>
                    <li>Service</li>
                    <li>Project</li>
                </ul>
            </nav>
        </div>
    )
}
export default Header;
